import React from 'react';

import { Modal, ModalHeader, ModalBody } from 'reactstrap';
import { IImportLigne } from 'app/shared/model/import-ligne.model';

export interface IMyAccountFullResultMapModalProps {
  isOpen;
  result;
}

export interface IMyAccountFullResultMapModalState {
    modal:boolean;
}

export class MyAccountFullResultMapModal extends React.Component<IMyAccountFullResultMapModalProps, IMyAccountFullResultMapModalState> {
  

    componentDidMount() {
    }
  
    render() {
      return (
        <div>
          <Modal isOpen={this.props.isOpen && this.props.result.length>0} 
                 className="text-center">
            <ModalHeader className="text-center">
              Fiche de l'entreprise
            </ModalHeader>
            <ModalBody className="text-center">
            Toto
            </ModalBody>
          </Modal>
        </div>
      );
    }
  }
